 * Modify the ABC string by inserting the specified clef (e.g., "clef=bass") after the tone line (K: ).
 * If no clef is specified, it defaults to "bass".
 *
 * @param {string} abc - The ABC notation string.
 * @param {string} [clef="bass"] - The clef to set (default is "bass").
 * @returns {string} - The updated ABC notation string with the new clef.
 */
function changedClef(abc, clef = "bass") {
    // Find the index of the tone line (K: ) in the ABC string
    const toneLineIndex = abc.indexOf('K:');

    // If the tone line is not found, return the original ABC string
    if (toneLineIndex === -1) {
        return abc;
    }

    // Insert the clef after the tone line
    const updatedAbc = abc.slice(0, toneLineIndex + 2) + 'clef=' + clef + abc.slice(toneLineIndex + 2);

    return updatedAbc;
}'}]

