 * Truncate the string to the specified length and add an ellipsis (...) if necessary. 
 * In addition, any <p> and </p> tags are removed from the truncated string.
 *
 * @param {string} str - The string to be truncated.
 * @param {number} num - The maximum number of characters allowed.
 * @returns {string} - The truncated string.
 */
function sliceString(str, num) {
    // Remove <p> and </p> tags
    let cleanStr = str.replace(/<p>/g, '').replace(/<\/p>/g, '');

    // If the string is longer than the specified length, truncate it and add an ellipsis
    if (cleanStr.length > num) {
        cleanStr = cleanStr.slice(0, num) + '...';
    }

    return cleanStr;
}"}]

