 * Finds the median of a given array of numbers.
 * 
 * @param {number[]} arr - The array of numbers to find the median of.
 * 
 * @returns {number} The median of the array.
 */
function findMedian(arr) {
    // First, we sort the array in ascending order
    arr.sort(function(a, b) {
        return a - b;
    });

    // Then, we find the middle index of the array
    var middleIndex = Math.floor(arr.length / 2);

    // If the array length is even, the median is the average of the two middle numbers
    if (arr.length % 2 === 0) {
        return (arr[middleIndex - 1] + arr[middleIndex]) / 2;
    }
    // If the array length is odd, the median is the middle number
    else {
        return arr[middleIndex];
    }
}'}]

