 * Sort the images in ascending order based on their scores and return the reordered image score, name, and ID
 *
 * @param {number[]} imageScores - Array of image scores.
 * @param {string[]} imageNames - Array of image names corresponding to the scores.
 * @param {string[]} imageIDs - Array of image IDs corresponding to the scores.
 * @returns {Object} An object containing the sorted scores, names, and IDs.
 */
function reorderData(imageScores, imageNames, imageIDs) {
    // Create an array of objects, each containing a score, name, and ID
    let data = imageScores.map((score, index) => ({ score, name: imageNames[index], id: imageIDs[index] }));

    // Sort the data array in ascending order by score
    data.sort((a, b) => a.score - b.score);

    // Extract the sorted scores, names, and IDs into separate arrays
    let sortedScores = data.map(item => item.score);
    let sortedNames = data.map(item => item.name);
    let sortedIDs = data.map(item => item.id);

    // Return an object containing the sorted scores, names, and IDs
    return {
        scores: sortedScores,
        names: sortedNames,
        ids: sortedIDs
    };
}'}]

