        for(let j = 0; j < rows.length; j++) {
            let row = rows[j];
            let cells = row.getElementsByTagName('td');
            let rowData = [];

            for(let k = 0; k < cells.length; k++) {
                rowData.push(cells[k].innerText);
            }

            tableData.push(rowData);
        }

        data.push(tableData);
